text:
Most of the websites use tools like Google Analytics or chat widgets like Crisp or Intercom.<p>Though they have a purpose but they affect the load time of your website which affects the SEO score. You can check the same on Google Lighthouse.<p>The effective way to solve this is by delaying the script load by 3-5 seconds.<p>Here&#x27;s a sample script to get it done.<p><pre><code>    &lt;script&gt;
        setTimeout(function () {
            &#x2F;&#x2F; Your script goes here.
        }, 3000);
    &lt;&#x2F;script&gt;
</code></pre>
Reference:  https:&#x2F;&#x2F;developer.chrome.com&#x2F;blog&#x2F;search-ads-speed&#x2F;
